/**
 * Checks if the user is logged in.
 * Redirects to the /forbidden page if the user is not logged in
 */
function authRequired ($rootScope, $q, $location, UserService) {
	var deferred = $q.defer();
	$rootScope.authInProgress = true;

	UserService.isLoggedIn().then(function(result) {
		if (result.data.data.logged_in === true) {
			$rootScope.loggedInUser = result.data.data.user;
			deferred.resolve(true);
		} else {
			$rootScope.loggedInUser = undefined;
			$location.path('/forbidden');
			deferred.reject();
		}
		
		$rootScope.authInProgress = false;
	});

	return deferred.promise;
}

/**
 * Updates the user login status
 */
function updateAuthStatus ($rootScope, $q, UserService){
	var deferred = $q.defer();
	$rootScope.authInProgress = true;

	UserService.isLoggedIn().then(function(result) {
		if (result.data.data.logged_in === true) {
			$rootScope.loggedInUser = result.data.data.user;
		} else {
			$rootScope.loggedInUser = undefined;
		}
		
		$rootScope.authInProgress = false;
		deferred.resolve(true);
	});

	return deferred.promise;
}

app.controller('addTabController', function ($scope, $location, TabService, ValidationService) {

	//default tab data
	$scope.formData = {
		type: 'tab',
		tunning: {
			type: 'Стандартен (EBGDAE)'
		},
		tab_type: 'full song',
		difficulty: 'Средна'
	};
	
	/**
	 * Function that is called when the tunnings custom select is opened. 
	 * It clears the errors that are visible in the 'other_tunning' input
	 */
	$scope.clearTunningErrors = function (){
		$('input[name=other_tunning]').closest('.field-box').removeClass('error');
	};

	/**
	 * Adds the new tab
	 * It opens the newly created tab on success
	 */
	$scope.addTab = function (){
		var formData = new FormData(document.getElementById('add-tab-form'));
		
		if(formData.get('tunning') === 'other'){
			formData.set('tunning', formData.get('other_tunning'));
		}
		
		formData.delete('other_tunning');
		
		TabService.addTab(formData).success(function (result){
			if (result.status === 0) {
				if (result.error) {
					
					//redirect the tunning error to the other_tunning input
					if(result.error.field === 'tunning'){
						result.error.field = 'other_tunning';
					}
					
					//show the error
					ValidationService.showError(result.error.field, result.error.error_code);
				}
			} else {
				//redirect to the newly added tab
				$location.path('/tab/'+result.data.tab_id);
			}
		});
	};
	
	/**
	 * Opens the hidden file input
	 */
	$scope.browse = function() {
		$('.file').click();
	};
	
	/*
	 * On file change
	 */
	$(document).on('change', '.file', function (event){
		var file = event.target.files[0];
		var extension = file.name.replace(/.+\./, '');
		var validExtensions = ['gp','gp3','gp4','gp5','gp6','gpx'];
		
		// Check file extension
		if(validExtensions.indexOf(extension) === -1) {
			ValidationService.showError('gp_file', 'invalid_file_extension');
		} else {
			// Check file size
			if((file.size / 1024) > 1000) {
				ValidationService.showError('gp_file', 'exceeds_max_file_size');
			}
		}
	});
	
});
app.controller('articleController', function($scope, $rootScope, $routeParams, $location, $sce, $q, $filter, ArticleService, ArticleCommentService, LoadingService, ValidationService) {
	$scope.limit = 6;
	$scope.offset = 0;

	$scope.articleId = $routeParams.id;
	
	/**
	 * Add new comment
	 */
	$scope.addComment = function(){
		ArticleCommentService.addArticleComment($scope.articleId, $scope.commentContent).success(function(result) {
			if(result.status === 0){
				if(result.error){
					//show the error
					ValidationService.showError(result.error.field, result.error.error_code);
				}
			}else{
				$scope.commentContent = '';
				$scope.getArticleComments(6, 0);
				
				//scroll to the latest comment
				var offset = $('.comments-wrapper').offset().top;
				$('html, body').animate({scrollTop: offset}, 500);
			}
		});
	};
	
	/**
	 * Fetches the article comments and renders them in the page
	 * @param {int} limit
	 * @param {int} offset
	 */
	$scope.getArticleComments = function(limit, offset) {
		$q.all([
			ArticleCommentService.getArticleComments($scope.articleId, limit, offset),
			ArticleCommentService.getTotalArticleComments($scope.articleId)
		]).then(function (result){
			$scope.articleComments = result[0].data.data;
			$scope.totalArticleComments = result[1].data.data;
		});
	};

	$q.all([
		ArticleService.getArticle($scope.articleId),
		ArticleCommentService.getArticleComments($scope.articleId, $scope.limit, $scope.offset),
		ArticleCommentService.getTotalArticleComments($scope.articleId)
	]).then(function (result){
		
		if(angular.isUndefined(result[0].data.data)){
			$location.path('/not-found');
		}else{
			//article content
			$scope.rawArticle = angular.copy(result[0].data.data);
			$scope.article = result[0].data.data;
			$scope.article.content = $scope.sanitizeArticleContent($scope.article.content);
						
			//article comments
			$scope.articleComments = result[1].data.data;
			
			//total number of article comments
			$scope.totalArticleComments = result[2].data.data;

			//render the share buttons manually
			stButtons.makeButtons();
			
			LoadingService.doneLoading();
		}
	});
	
	/**
	 * Sanitizes the article content replacing the new lines with <br> tags and applying emoticons
	 * @param {String} content
	 * @returns {String}
	 */
	$scope.sanitizeArticleContent = function (content) {
		content = content.replace(/(\r\n|\r|\n)/g, '<br/>');
		content = $filter('emoticons')(content);
		content = $sce.trustAsHtml(content);	
		return content;
	};
	
	/**
	 * Opens article edit modal
	 */
	$scope.openEditModal = function() {
		$scope.editData = angular.copy($scope.rawArticle);
		$scope.editData.date = $scope.editData.date.replace('T', ' ');
		
		//clear all errors (if any)
		$('#edit-article-modal .field-box').removeClass('error');
		
		$('#edit-article-modal').modal('show');
	};
	
	/**
	 * Closes the edit modal on success
	 * It fetches the updated article data
	 */
	$scope.closeEditModal = function () {
		ArticleService.getArticle($scope.articleId).then(function (result){
			$scope.rawArticle = angular.copy(result.data.data);
			$scope.article = result.data.data;
			$scope.article.content = $scope.sanitizeArticleContent($scope.article.content);
			
			$('#edit-article-modal').modal('hide');
		});
	};
	
	$('#edit-article-datepicker').datetimepicker({
		changeMonth: true,
		changeYear: true,
		yearRange: '1940:' + new Date().getFullYear(),
		monthNamesShort: ['Януари', 'Февруари', 'Март', 'Април', 'Май', 'Юни', 'Юли', 'Август', 'Септември', 'Октомври', 'Ноември', 'Декември'],
		dayNamesMin: ['Нед', 'Пон', 'Вт', 'Ср ', 'Чет', 'Пет', 'Съб'],
		firstDay: 1,
		dateFormat: 'yy-mm-dd',
		timeFormat: 'HH:mm:ss',
		hour: new Date().getHours(),
		minute: new Date().getMinutes(),
		second: new Date().getSeconds()
	});
	
	/**
	 * Opens the hidden file input
	 */
	$scope.browse = function() {
		$('.image').click();
	};
	
	/*
	 * On image file change generate article image preview
	 */
	$('.image').change(function(event) {		
		var file = event.target.files[0];
		
		// Check image extensions
		if(/image\/(jpe?g|png)/i.test(file.type) === false){
			ValidationService.showError('image', 'invalid_file_extension');
		} else {
			// Check image size
			if((file.size / 1024) > 1000) {
				ValidationService.showError('image', 'exceeds_max_file_size');
			} else {
				$('#edit-article-form .article-image').attr('src', URL.createObjectURL(event.target.files[0]));
			}
		}
	});
	
	/**
	 * Callback function that is called when the save changes button is pressed
	 */
	$scope.submitEditArticleForm = function() {
		var formData = new FormData(document.getElementById('edit-article-form'));
		
		ArticleService.updateArticle(formData).success(function (result){
			if (result.status === 0) {
				if (result.error) {
					//show the error
					ValidationService.showError(result.error.field, result.error.error_code);
				}
			} else {
				$scope.closeEditModal();
			}
		});
	};
	
});
app.controller('articlesController', function ($scope, ArticleService, LoadingService) {

	$scope.limit = 6;
	$scope.offset = 0;
	$scope.articles = [];

	/**
	 * Loads the articles from the database
	 * @param {int} limit
	 * @param {int} offset
	 */
	$scope.loadArticles = function (limit, offset) {
		ArticleService.getArticles(limit, offset).success(function (result) {
			console.log(result.data);
			if (result.error) {
				console.log(result.error);
			} else {
				LoadingService.doneLoading();
				$scope.articles = $scope.articles.concat(result.data);
				
				//hide the load more button if there are no more articles
				if(result.data.length < $scope.limit){
					$scope.noMoreArticles = true;
				}
			}
		});
	};
	
	$scope.loadArticles($scope.limit, $scope.offset);

});
app.controller('changePasswordController', function ($scope, $routeParams, PasswordResetService, UserService, ValidationService, LoadingService) {
	$scope.success = false;
	$scope.formData = {
		user_id: $routeParams.userId,
		hash: $routeParams.hash
	};
	
	/**
	 * Check if the userId/token combination is valid and hasn't expired
	 */
	PasswordResetService.checkPasswordResetHash($routeParams.userId, $routeParams.hash).then(function (result){
		if(result.data.status === 1){
			$scope.validToken = true;
		}
		//invalid or expired token
		else{
			$scope.validToken = false;
		}
		
		LoadingService.doneLoading();
	});
	
	/**
	 * Changes the user password
	 */
	$scope.changePassword = function () {
		UserService.updatePassword($scope.formData).then(function (result){
			if (result.data.status === 0) {
				if (result.data.error) {
					//intercept hash errors and directly show the invalid token screen
					if(result.data.error.field === 'hash'){
						$scope.validToken = false;
					}else{
						//show the error
						ValidationService.showError(result.data.error.field, result.data.error.error_code);
					}
				}
			} else {
				//show the change password success message
				$scope.success = true;
			}
		});
	};	
	
});
