app.factory('LoadingService', function() {
	
	var contentElement = '#view-wrapper';
	var loadingElement = '#content-wrapper > .loading-placeholder';
	
	return {
		/**
		 * Shows the loading placeholder
		 */
		showLoadingPlaceholder: function (){
			$(loadingElement).fadeIn(0);
		},
		/**
		 * Hides the loading placeholder
		 */
		hideLoadingPlaceholder: function (){
			$(loadingElement).fadeOut(0);
		},
		/**
		 * Shows the ng-view content
		 */
		showContent: function (){
			$(contentElement).css('visibility', 'visible');
		},
		/**
		 * Hides the ng-view content
		 */
		hideContent: function (){
			$(contentElement).css('visibility', 'hidden');
		},
		/**
		 * Hides the ng-view content and shows the loading placeholder
		 */
		startLoading: function() {
			var self = this;
			
			self.hideContent();
			setTimeout(function (){
				self.showLoadingPlaceholder();
			}, 200);
		},
		/**
		 * Hides the loading placeholder and shows the ng-view content
		 */
		doneLoading: function() {
			var self = this;
			
			setTimeout(function (){
				self.hideLoadingPlaceholder();
				self.showContent();
			}, 300);
		}
	};
});
app.factory('ValidationService', function($filter) {
	return {
		showError: function(field, errorCode) {
			var errorMessage = $filter('errors')(errorCode);
			var fieldBox = $('input[name="' + field + '"], textarea[name="' + field + '"], select[name="' + field + '"]').closest('.field-box');
			fieldBox.find('.error-msg').html(errorMessage);
			fieldBox.addClass('error');
		},
		hideError: function(elementSelector) {
			$(elementSelector).removeClass('error');
			$(elementSelector).find('.field-box').removeClass('error');
			$(elementSelector).find('.error-msg').html('');
		}
	};
});
app.controller('addArticleController', function ($scope, $location, ArticleService, ValidationService) {
	
	/**
	 * Opens the hidden file input
	 */
	$scope.browse = function() {
		$('.image').click();
	};
	
	/*
	 * On image file change generate article image preview
	 */
	$('.image').change(function(event) {		
		var file = event.target.files[0];
		
		// Check image extensions
		if(/image\/(jpe?g|png)/i.test(file.type) === false){
			ValidationService.showError('image', 'invalid_file_extension');
		} else {
			// Check image size
			if((file.size / 1024) > 1000) {
				ValidationService.showError('image', 'exceeds_max_file_size');
			} else {
				$('#add-article-form .article-image').attr('src', URL.createObjectURL(event.target.files[0]));
			}
		}
	});
	
	$('#add-article-datepicker').datetimepicker({
		changeMonth: true,
		changeYear: true,
		yearRange: '1940:' + new Date().getFullYear(),
		monthNamesShort: ['Януари', 'Февруари', 'Март', 'Април', 'Май', 'Юни', 'Юли', 'Август', 'Септември', 'Октомври', 'Ноември', 'Декември'],
		dayNamesMin: ['Нед', 'Пон', 'Вт', 'Ср ', 'Чет', 'Пет', 'Съб'],
		firstDay: 1,
		dateFormat: 'yy-mm-dd',
		timeFormat: 'HH:mm:ss',
		hour: new Date().getHours(),
		minute: new Date().getMinutes(),
		second: new Date().getSeconds()
	});
	
	/**
	 * Callback function that is called when the publish button is pressed
	 */
	$scope.addArticle = function() {
		var formData = new FormData(document.getElementById('add-article-form'));
		
		ArticleService.addArticle(formData).success(function (result){
			if (result.status === 0) {
				if (result.error) {
					//show the error
					ValidationService.showError(result.error.field, result.error.error_code);
				}
			} else {
				//redirect to the newly created article
				$location.path('/article/'+result.data.article_id);
			}
		});
	};
	
	
});
app.controller('profileController', function ($rootScope, $scope, $routeParams, $q, $location, UserService, UserCommentService, UserReportService, LoadingService, ValidationService) {

	$scope.loggedInUser = $rootScope.loggedInUser;

	$scope.limit = 6;
	$scope.offset = 0;

	$q.all([
		UserService.getUser($routeParams.id),
		UserCommentService.getUserComments($routeParams.id, $scope.limit, $scope.offset),
		UserCommentService.getTotalUserComments($routeParams.id),
	]).then(function (responses){

		if(angular.isDefined(responses[0].data.data)){
			$scope.userData = responses[0].data.data;
			
			$scope.userComments = responses[1].data.data;
			$scope.totalUserComments = responses[2].data.data;
		
			LoadingService.doneLoading();
		}else{
			$location.path('/not-found');
		}
	});
	
	$('.glyphicon-info-sign').popover({
		container: 'body',
		trigger: 'hover',
		placement: 'right',
		html: true,
		content: $('#reputation-popover-message').html()
	});

	/**
	 * Add new comment
	 */
	$scope.addComment = function(){
		UserCommentService.addUserComment($routeParams.id, $scope.commentContent).success(function(result) {
			if(result.status === 0){
				if(result.error){
					//show the error
					ValidationService.showError(result.error.field, result.error.error_code);
				}
			}else{
				$scope.commentContent = '';
				$scope.getUserComments(6, 0);
				
				//scroll to the latest comment
				var offset = $(".comments-wrapper").offset().top;
				$("html, body").animate({scrollTop: offset}, 500);
			}
		});
	};
	
	/**
	 * Fetches the user comments and renders them in the page
	 * @param {int} limit
	 * @param {int} offset
	 */
	$scope.getUserComments = function(limit, offset) {
		$q.all([
			UserCommentService.getUserComments($routeParams.id, limit, offset),
			UserCommentService.getTotalUserComments($routeParams.id)
		]).then(function (result){
			$scope.userComments = result[0].data.data;
			$scope.totalUserComments = result[1].data.data;
		});
	};
	
	/**
	 * Opens the report user modal
	 */
	$scope.openReportModal = function() {
		$scope.reportSuccess = false;
		
		$scope.reportedUser = {
			id: $scope.userData.ID,
			username: $scope.userData.username,
			reason: 'rude language',
			other: ''
		};
		
		//hide all errors in the report profile modal
		ValidationService.hideError('#report-profile-modal');
		
		$scope.$watch('reportedUser', function() {
			if($scope.reportedUser.reason !== 'other') {
				$scope.reportedUser.other = '';
			}
		}, true);
		
		$('#report-profile-modal').modal('show');
	};
	
	/**
	 * Reports the provided user
	 * @param {Object} reportedUser
	 */
	$scope.reportUser = function(reportedUser) {
		var reason;
		
		if(reportedUser.reason === 'other'){
			reason = reportedUser.other;
		}else{
			reason = reportedUser.reason;
		}
		
		UserReportService.reportUser(reportedUser.id, reason).then(function (result){
			if (result.data.status === 0) {
				if (result.data.error) {
					//show the error
					ValidationService.showError(result.data.error.field, result.data.error.error_code);
				}
			} else {
				$scope.reportSuccess = true;
			}
		});
		
	};
	
	/**
	 * Opens the hidden file input
	 */
	$scope.browse = function() {
		$('.avatar').click();
	};
	
	/**
	 * Resets the form
	 */
	$scope.resetEditForm = function() {
		$scope.editData = {
			password: '',
			repeat_password: '',
			photo: $scope.userData.photo,
			location: $scope.userData.location,
			occupation: $scope.userData.occupation,
			web: $scope.userData.web,
			about_me: $scope.userData.about_me,
			instrument: $scope.userData.instrument,
			favourite_bands: $scope.userData.favourite_bands
		};
		
		//hide all errors in the edit profile modal
		ValidationService.hideError('#edit-profile-modal');
	};
	
	/**
	 * Opens the edit profile modal
	 */
	$scope.openEditModal = function() {
		$scope.resetEditForm();
		$('#edit-profile-modal').modal('show');
	};
		
	/**
	 * Callback function that is called when the save button is pressed
	 */
	$scope.submitEditProfileForm = function () {
		
		var formData = new FormData(document.getElementById("edit-profile-form"));
		
		UserService.updateUser(formData).success(function (result){
			if (result.status === 0) {
				if (result.error) {
					//show the error
					ValidationService.showError(result.error.field, result.error.error_code);
				}
			} else {
				//close the modal
				$('#edit-profile-modal').modal('hide');
				
				//reload the user data and user comments
				UserService.getUser($routeParams.id).then(function (result){
					$scope.userData = result.data.data;
					$rootScope.loggedInUser = result.data.data;
					$scope.getUserComments($scope.limit, $scope.offset);
				});
			}
		});

	};
	
	/*
	 * On avatar file change generate avatar preview
	 */
	$('.avatar').change(function(event) {		
		var file = event.target.files[0];
		
		// Check image extensions
		if(/image\/(jpe?g|png)/i.test(file.type) === false){
			ValidationService.showError('avatar', 'invalid_file_extension');
		} else {
			// Check image size
			if((file.size / 1024) > 1000) {
				ValidationService.showError('avatar', 'exceeds_max_file_size');
			} else {
				$('#edit-profile-form .user-avatar').attr('src', URL.createObjectURL(event.target.files[0]));
			}
		}
	});

});
app.controller('userFavouritesController', function ($rootScope, $scope, $routeParams, $q, UserFavouriteService) {
	
	$scope.profileId = parseInt($routeParams.id);
	$scope.loggedInUser = $rootScope.loggedInUser;

	$scope.limit = 20;
	$scope.offset = 0;

	/**
	 * Returns the specified user favourite tabs
	 * @param {int} limit
	 * @param {int} offset
	 */
	$scope.getUserFavourites = function (limit, offset){
		$q.all([
			UserFavouriteService.getUserFavourites($routeParams.id, limit, offset),
			UserFavouriteService.getTotalUserFavourites($routeParams.id)
		]).then(function (result){
			$scope.userFavourites = result[0].data.data;
			$scope.totalUserFavourites = result[1].data.data;
		});
	};
	
	/**
	 * Deletes the specified user tab from the user favourites list
	 * @param {int} tabId
	 */
	$scope.deleteFavouriteTab = function (tabId){
		UserFavouriteService.deleteFavouriteTab(tabId).then(function (){
			//manually reduce the number of favourites
			$scope.totalUserFavourites--;
			
			//if the user has deleted the last tab on the page - reduce the offset by one page
			if($scope.offset >= $scope.totalUserFavourites){
				$scope.offset = $scope.offset - $scope.limit;
			}
			
			//reload the page
			$scope.getUserFavourites($scope.limit, $scope.offset);
		});
	};
	
	//get the first batch of tabs
	$scope.getUserFavourites($scope.limit, $scope.offset);

});
app.controller('userSearchController', function($scope, $routeParams, $q, UserService, ValidationService) {

	$scope.keyword = '';
	$scope.limit = 20;
	$scope.offset = 0;

	/**
	 * Callback function that is called when the search button is pressed
	 * It resets the pagination offset and launches new search
	 */
	$scope.newSearch = function (){
		$scope.offset = 0;
		$scope.search($scope.limit, $scope.offset, $scope.keyword);
	};

	/**
	 * Used to search for users
	 * @param {int} limit
	 * @param {int} offset
	 * @param {String} keyword
	 */
	$scope.search = function(limit, offset, keyword) {
		$q.all([
			UserService.search(keyword, limit, offset),
			UserService.getTotalSearchResults(keyword)
		]).then(function (results){
			if(results[0].data.status === 0){
				if (results[0].data.error) {
					//show the error
					ValidationService.showError(results[0].data.error.field, results[0].data.error.error_code);
				}
			}else{
				$scope.users = results[0].data.data;
				$scope.totalUsers = results[1].data.data;
			}
		});

	};


});
